import React from 'react';
import { useSelector } from 'react-redux';

function Card() {
  const movies = useSelector((state) => state.MovieData.movies);

  return (
    <div>
      <div className='cards'>
        {
          movies.map((movie) => (
            <>
              <img></img>
              <dvi><span style={{color:"white"}} key={movie.id}>{movie.title}</span>
              </dvi>
            </>
          ))
        }
      </div>
    </div>
  );
}

export default Card;
